import ExpenseItem from './ExpenseItem';
import './Expenses.css';
function Expenses(props){

    <div className='expenses'>
         {props.expenses.map(x => <ExpenseItem title={x.title} amount={x.amount} date={x.date}></ExpenseItem>)}
    </div>
}

export default Expenses
